import React from 'react';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepLabel from '@material-ui/core/StepLabel';
import TextField from '@material-ui/core/TextField';
import { makeStyles } from '@material-ui/core/styles';
import './index.scss';

const useStyles = makeStyles((theme) => ({
  image: {
    backgroundImage: 'url(https://source.unsplash.com/random)',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  logoBig: {
    marginTop: 22,
    marginBottom: 40,
    backgroundColor: '#DEDEDE',
    color: '#FFFFFF',
  },
  loginButton: {
    backgroundColor: '#4E5674',
    borderRadius: 10,
    width: 150,
    height: 50,
  },
  root: {
    width: '100%',
  },
  pruebaa: {
    marginLeft: 90,
    marginRight: 90,
    width: 250,
  },

}));

function getSteps() {
  return ['Primer paso', 'Segundo paso', 'Tercer paso', 'Cuarto paso'];
}

export const RegisterSeven = () => {
  const classes = useStyles();
  const [activeStep] = React.useState(0);
  const steps = getSteps();

  return (
    <Grid container component="main" className={classes.root}>

      <Grid item xs={false} sm={3} md={3} className={classes.image} />
      <Grid item xs={12} sm={9} md={9} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <Button variant="contained" className={classes.logoBig}>Logo</Button>

          <Stepper activeStep={activeStep} alternativeLabel>
            {steps.map((label) => (
              <Step key={label}>
                <StepLabel>{label}</StepLabel>
              </Step>
            ))}
          </Stepper>

          <form className={classes.root} noValidate autoComplete="off">


            <div className='cuadroMayor'>
              <p className='textNomb'>Nombre</p>
              <TextField
                variant="outlined"
                margin="normal"
                id="standard-search"
                label="Nombre"
                name="Nombre"
                className={classes.pruebaa}
              />
              {/* <p className='nombre'>Nombre</p> */}
              <TextField
                variant="outlined"
                margin="normal"
                id="standard-search"
                label="Ubicación"
                name="Ubicación"
                className={classes.pruebaa}
              />
            </div>

            <div className='cuadroMayor'>
              <p className='textCorreooo'>Correo</p>
              <TextField
                variant="outlined"
                margin="normal"
                id="standard-search"
                label="Correo"
                name="Correo"
                className={classes.pruebaa}
              />
              {/* <p className='nombre'>Nombre</p> */}
              <TextField
                variant="outlined"
                margin="normal"
                id="standard-search"
                label="Contraseña"
                name="Contraseña"
                className={classes.pruebaa}
              />
            </div>

            <div className='cuadroMayor3'>
              <p className='textEdaddd'>Edad</p>
              <TextField
                variant="outlined"
                margin="normal"
                id="standard-search"
                label="Edad"
                name="Edad"
                className={classes.pruebaa}
              />
              {/* <p className='nombre'>Nombre</p> */}
              <TextField
                variant="outlined"
                margin="normal"
                id="standard-search"
                label="Confirmar contraseña"
                name="Confirmar contraseña"
                className={classes.pruebaa}
              />
            </div>


            <div className='cuadroMayor3'>
              <p className='textTele'>Teléfono</p>
              <TextField
                variant="outlined"
                margin="normal"
                id="standard-search"
                label="Teléfono"
                name="Teléfono"
                className={classes.pruebaa}
              />
              {/* <p className='nombre'>Nombre</p> */}
              <TextField
                className={classes.pruebaa}
              />
            </div>



          </form>

          <div className='login'>
            <Button
              type="submit"
              variant="contained"
              color="primary"
              className={classes.loginButton}
            >
              Siguiente
            </Button>
          </div>
        </div>
      </Grid>
    </Grid>
  );
}
